svg.script:
const cardsJSON = [
 {'Pro': false, 'Stamina': false, 'a': 1, 'b': 1, 'c': 1, 'd': 1, 'crit_fail': true},
 {'Pro': false, 'Stamina': false, 'a': 1, 'b': 2, 'c': 3, 'd': 2},
 {'Pro': false, 'Stamina': false, 'a': 1, 'b': 4, 'c': 3, 'd': 4},
 {'Pro': false, 'Stamina': false, 'a': 2, 'b': 2, 'c': 3, 'd': 4},
 {'Pro': false, 'Stamina': false, 'a': 2, 'b': 3, 'c': 2, 'd': 3},
 {'Pro': false, 'Stamina': false, 'a': 1, 'b': 2, 'c': 2, 'd': 3},
 {'Pro': false, 'Stamina': false, 'a': 2, 'b': 1, 'c': 2, 'd': 3},
 {'Pro': true,  'Stamina': false, 'a': 1, 'b': 1, 'c': 4, 'd': 1},
 {'Pro': true,  'Stamina': false, 'a': 2, 'b': 2, 'c': 1, 'd': 2},
 {'Pro': false, 'Stamina': false, 'a': 3, 'b': 1, 'c': 2, 'd': 2},
 {'Pro': false, 'Stamina': true, 'a': 4, 'b': 4, 'c': 4, 'd': 4, 'crit_win': true},
 {'Pro': false, 'Stamina': true, 'a': 1, 'b': 3, 'c': 3, 'd': 4},
 {'Pro': false, 'Stamina': true, 'a': 3, 'b': 3, 'c': 4, 'd': 4},
 {'Pro': false, 'Stamina': true, 'a': 3, 'b': 4, 'c': 3, 'd': 4},
 {'Pro': true , 'Stamina': true, 'a': 1, 'b': 2, 'c': 2, 'd': 4},
 {'Pro': true,  'Stamina': true, 'a': 3, 'b': 2, 'c': 1, 'd': 2},
 {'Pro': true,  'Stamina': true, 'a': 4, 'b': 1, 'c': 1, 'd': 2},
 {'Pro': false, 'Stamina': true, 'a': 3, 'b': 4, 'c': 3, 'd': 4},
 {'Pro': false, 'Stamina': true, 'a': 1, 'b': 3, 'c': 4, 'd': 2},
 {'Pro': false, 'Stamina': true, 'a': 3, 'b': 3, 'c': 4, 'd': 3},
]

function pile_offset(index) {
  return {
    x: 0.2 * index,
    y: 0.66 * index,
  }
}

var deckahedron = {

  shuffle: function(deckJSON) {
    // TODO
    return deckJSON
  },

  flip_handler: function(evt) {
    console.log("FLIP", evt)

    var deck

    if (evt.target.classList.contains('deckahedron_deck')) {
      deck = evt.target
    } else {
      deck = evt.target.querySelector('.deckahedron_deck')
    }
    local_doc = deck.closest('.svg_deckahedron')

    play_area_group = local_doc.querySelector('#play_area')

    var card

    if (evt.detail.selectedCardId) {
      // user is dragging a card
      card = SVG.adopt(byId(evt.detail.selectedCardId))
    } else if (deck.childNodes.length !== 0) {
      // take the top card off the deck
      card = SVG.adopt(deck.lastChild)
    } else {
      console.log('no card')
      return;
    }

    play_area_pos = local_doc.querySelector('#play_area_ellipse')
    play_area_pos = SVG.adopt(play_area_pos)

    offset = pile_offset(play_area_group.childNodes.length)
    card.cx(play_area_pos.cx() + offset.x)
    card.cy(play_area_pos.cy() - 50 + offset.y)

    back = card.node.querySelector('.card_back')
    back.remove()
    card.node.insertBefore(back, card.node.firstChild)

    card.remove() // remove from deck or exhaustion pile
    play_area_group.appendChild(card.node)

    console.log("after", card.cx(), card.cy())
  },

  exhaustion_handler: function(evt) {
    console.log("EXH", evt)

    var deck

    if (evt.target.classList.contains('deckahedron_deck')) {
      deck = evt.target
    } else {
      deck = evt.target.querySelector('.deckahedron_deck')
    }
    local_doc = deck.closest('.svg_deckahedron')

    card = SVG.adopt(byId(evt.detail.selectedCardId))
    ex_area = local_doc.querySelector('#rect_area_exhaustion')
    ex_area = SVG.adopt(ex_area)

    card.cx(ex_area.cx())
    card.cy(ex_area.cy())

    card.remove() // remove from deck
    exhaustion_area_group = local_doc.querySelector('#exhaustion_area')
    exhaustion_area_group.appendChild(card.node)

  },

  reshuffle_handler: function(evt) {
    console.log("RESHUF", evt)
  },

  jittered: function(src, min, max) {
    min = Math.ceil(min)
    max = Math.floor(max)
    return '' + (src + (Math.floor(Math.random() * (max - min + 1)) + min))
  },

  generate_card: function(cardJSON, unique_id, deck_id) {
    console.log('ccc', cardJSON['a'])
    var mymap = {
      1: 'one_x',
      2: 'one_check',
      3: 'two_check',
      4: 'three_check',
    }

    back_group = document.querySelector('#layer_back')
    trans_x = SVG.adopt(back_group).x()
    trans_y = SVG.adopt(back_group).y()
    back = SVG.adopt(back_group.querySelectorAll('rect')[0])
    console.log('tr', back.x(), back.y())

    var cardText = JSON.stringify(cardJSON)
    var card = document.createElementNS(SVG.ns, 'svg')
    card.dataset.deckahedronCard = cardJSON
    card.dataset.deckId = deck_id
    card.id = unique_id
    var jitterHighlight = (
      '<rect class="card_jitter_highlight" x="'
      + this.jittered(170, 0, 10)
      + '" y="213" width="20" height="1" fill="#222" />'
    )
    std_trans = ' x="-' + trans_x + '" y="-' + trans_y + '" '
    card.innerHTML = (
      `
       <use `+ std_trans +` href="#layer_bg_lighting" />
       <use `+ std_trans +` href="#layer_bg" />
       <use `+ std_trans +` href="#layer_books_flourish" />
       <text
         style="font-size:8px;line-height:125%;fill:#000000;fill-opacity:1;"
         x="20"
         y="60"
         ><tspan>` +
      cardText +
      '</tspan></text>'
      + '<use x="-'+ trans_x +'" href="#g_anchor_' + mymap[cardJSON['a']] + '" />'
      + '<use x="-'+ trans_x +'" href="#g_bulb_' + mymap[cardJSON['b']] + '" />'
      + '<use x="-'+ trans_x +'" href="#g_crescent_' + mymap[cardJSON['c']] + '" />'
      + '<use x="-'+ trans_x +'" href="#g_dart_' + mymap[cardJSON['d']] + '" />'
      + '<use id="cb_'+ unique_id +'" class="card_back" href="#layer_back_sans_translate" />'
      + jitterHighlight
    )
    card = SVG.adopt(card)
    card.width(back.width())
    card.height(back.height())
    card.addClass('draggable-group')
    card.node.addEventListener('svg_dragstart', (evt) => {
      console.log('listening', evt.detail, card.node.id)
      if (evt.detail.elemId === card.node.id) {
        console.log('its me', card.node.id)
      }
    })
    return card
  },

  generate_deck: function(elem) {
    console.log('gen')
    handle = SVG(elem)
    deck = handle.group()
    deck.addClass('deckahedron_deck')
    deck_id = 'deck_' + base32.short_id()
    deck.id(deck_id)
    handle.add(deck)

    var deck_area = elem.querySelector('#rect_area_deck')
    deck_area = SVG.adopt(deck_area)
    console.log('da', deck_area.cx(), deck_area.cy())

    var index = 0
    this.shuffle(cardsJSON).map((cardJSON) => {
      card = this.generate_card(cardJSON, 'c' + (index+1) + deck_id, deck_id)
      console.log('card', card.cx(), card.cy())
      // TODO - why do i need this 20 pixel fudge?
      card.cy(deck_area.cy() - (20 + pile_offset(index).y))
      card.cx(deck_area.cx() + pile_offset(index).x)
      deck.add(card)
      index += 1
    })
  },

  drag_handler: function(evt) {
    //console.log('tt', new Date())
    //console.log('t', evt.target.id, evt.detail)
    card = SVG.get(evt.target.id)
    play_area = SVG.get('ellipse_play_area')
    ex_area = SVG.get('rect_area_exhaustion')

    console.log('c', card.cx(), card.cy())
    console.log('e', ex_area.inside(card.cx(), card.cy()))

    if (play_area.inside(card.cx(), card.cy())) {
      card.style({ opacity: 0.8 })
    } else if (ex_area.inside(card.cx(), card.cy())) {
      card.style({ opacity: 0.8 })
    } else {
      card.style({ opacity: 1.0 })
    }
  },

  dragend_handler: function(evt) {
    play_area = SVG.get('ellipse_play_area')
    ex_area = SVG.get('rect_area_exhaustion')

    card = SVG.get(evt.target.id)
    card.style({ opacity: 1.0 })

    if (play_area.inside(card.cx(), card.cy())) {
      console.log('1dropped in play area', card.node.dataset.deckId)
      deck = byId(card.node.dataset.deckId)
      evt_fire('deckahedron_flip', deck, evt, {selectedCardId: card.node.id})
    } else if (ex_area.inside( card.cx(), card.cy())) {
      console.log('dropped in ex area')
      evt_fire('deckahedron_exhaustion', deck, evt, {selectedCardId: card.node.id})
    } else {
      console.log('dropped elsewhere')
    }
  },

  hookup_handlers: function(elem) {
    this.generate_deck(elem)
    console.log('hookup', elem)
    elem.addEventListener('deckahedron_flip', this.flip_handler)
    elem.addEventListener('deckahedron_exhaustion', this.exhaustion_handler)
    elem.addEventListener('deckahedron_reshuffle', this.reshuffle_handler)
    byId('ellipse_play_area').classList.add('droptarget')
    elem.addEventListener('svg_drag', this.drag_handler)
    elem.addEventListener('svg_dragend', this.dragend_handler)
  },

  v1_menu: {
    'Flip': {
      eventName: 'deckahedron_flip',
      applicable: (dNode) => {
        deck = dNode.querySelector('.deckahedron_deck')
        if (deck.childNodes.length === 0) {
          return false;
        }
        return true
      },
    },
    'Reshuffle': {
      eventName: 'deckahedron_reshuffle',
      applicable: (dNode) => { return true },
    },
  },

}
